import PropTypes from 'prop-types';

const PostImages = ({ images }) => {
    if (images.length === 1){
        return(
            <>
                <img src={images[0].src} alt={images[0].src} onClick={onZoom}/>
            </>
        );
    }
    return(
        <div>구현중...</div>
    );
}

PostImages.propTypes = {
    images: PropTypes.arrayOf(PropTypes.object),
}

export default PostImages;
